import { useEffect, useState } from "react";

const ContentPLace = ({ socket }) => {
    const [part, setPart] = useState(null);

    useEffect(() => {
        socket.on("displayPartS", part => {
          setPart(part);
        });
      }, []);

    return (
        <div className="content-place">
            <iframe width="560" height="315" src="https://www.youtube.com/embed/muF58WFsXMw?start=1" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div>
    )
}

export default ContentPLace
